Bucle for

8

- El bucle for permite controlar el número de iteraciones mediante una variable (contador).

- La sintaxis es la siguiente:

  for (inicialización; condición; incremento) {

   [Bloque de instrucciones];

  }

- Ejemplo 1:

for (int i=0; i<100; i++) {

System.out.println(i);

}

- Ejemplo 2:

for (int i=0; i<100; i+=2) {

System.out.println(i);

}

