- Condición: La condición es única y su evaluación dará como resultado un booleano. Se pueden 

utilizar operadores relacionales (<, >, >=, <=, !=, ==) y lógicos (&&, ||, !).

- Incremento: Se ejecuta al final de cada iteración. Puede contener varias instrucciones separadas 

por comas.

