- Existen sentencias en Java (y en la mayoría de lenguajes) para terminar un bucle o iteracción en 

determinadas circunstancias.

- Java nos proporciona las siguientes instrucciones:

break: interrumpe la ejecución del bucle.

continue: interrumple la iteración actual y continúa en la siguiente.

- Ejemplo 1:

for (int i=1; i<100; i++) {

if (i%10==0)

break;

System.out.println(i);

}

El uso de break/continue puede ser útil en algunas situaciones, pero deben usarse con 

precaución para evitar código confuso y difícil de mantener.

- Ejemplo 2:

for (int i=1; i<100; i++) {

if (i%10==0)

continue;

System.out.println(i);

}

