Bucles anidados

12

- Es posible incluir un bucle dentro de otro bucle. Es frecuente su uso en programas de cierta 

complejidad, por ejemplo, en el recorrido de arrays multidimensionales.

- Los bucles anidados no tienen por que ser del mismo tipo.

- Se pueden anidar tantos bucles como sea necesario.

- Las variables contador del bucle externo e interno puede ser independiente o dependientes.

- Ejemplo 1:

 for (int i=1; i<10; i++) {

  for (int j=1; j<5; j++) {

   System.out.println(i+ "-" + j);

  }

 }

- Ejemplo 2:

 for (int i=1; i<=5; i++) {

  for (int j=1; j<=i; j++) {

   System.out.print("* ");

  }

 System.out.println();

 }

